import React, { Fragment } from 'react';
import { Link } from 'react-router-dom';
import Spinner from '../layout/Spinner';
import Ticket from '../ticket/Ticket';

const DashboardTickets = ({ user, loading }) => {

  return (
     loading && user === null ? <Spinner /> : 
        <Fragment>
        <div className="dashboard">
        <h1 className='large text-primary'>Welcome {user && user.name}</h1>

        </div>  

        {user.tickets.length === 0 ? 
          (
         <Fragment>  
              <p>You have not yet bought any tickets</p>
          <Link className="films-link" to="/">
            <p>Click here to search films</p> 
          </Link>
          </Fragment>
          ) :
          (   
        <Fragment>
        <h1 className="displayHeader">Your tickets</h1>
        <div className="displayDash">{user.tickets.map(item => (         
             <div 
             className="singleTicket"
             key={item._id}>
             <Ticket
               ticket={item}
             />
             </div> 
        ))}
        </div> 
        </Fragment>
         ) 
       }    
      </Fragment>
    )

  }  

export default DashboardTickets;
